import { Box, Image, Text, VStack } from "@chakra-ui/react";

export const CharCard = ({ character }) => {
  return (
    <>
      <Box>
        <VStack>
          <Image
            src={character.image}
            alt={character.name}
            w="200px"
            h="200px"
          />
          <Text>{character.Name}</Text>
          <Text>{character.gender}</Text>
          <Text>{character.species}</Text>
        </VStack>
      </Box>
    </>
  );
};
